import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Switch, Link } from 'react-router-dom';
//import "./Navbar.css"
function Navbar(){
    const [page, setPage] = useState('Home');
    function handleMenu(menupage){
        setPage(menupage);
    }
    return (
        
            <div>
          
          <nav>
            <ul>
              
              <Link onClick={handleMenu.bind(this,'Seller')} className={page === 'Seller' ? 'activePage' : ''} to="/menu">Seller Login </Link>
              <Link onClick={handleMenu.bind(this,'Admin')} className={page === 'Admin' ? 'activePage' : ''} to="/refer">Admin Login </Link>
              <Link onClick={handleMenu.bind(this,'Register')} className={page === 'Register' ? 'activePage' : ''} to="/register">Register</Link>
            </ul>
          </nav>
          
        </div>
        
      );
}

export default Navbar;
